import React from "react";
// react component that copies the given text inside your clipboard
import { CopyToClipboard } from "react-copy-to-clipboard";
// reactstrap components
import {
  Card,
  CardHeader,
  CardBody,
  Container,
  Row,
  Col,
  UncontrolledTooltip,
  CardImg, CardText,
  CardTitle, CardSubtitle, Button
} from "reactstrap";
// core components
import Header from "components/Headers/Header.jsx";
import krazyball from "/Users/gregorymoncayo/Desktop/ToUpper LLC/WebSite/src/assets/img/brand/football.png";

class Icons extends React.Component {
  state = {};
  render() {
    return (
      <div>
      <Card>
        <CardImg top width="100%" src="/Users/gregorymoncayo/Desktop/ToUpper LLC/WebSite/src/assets/img/brand/football.png" alt="Card image cap" />
        <CardBody>
          <CardTitle>Card title</CardTitle>
          <CardSubtitle>Card subtitle</CardSubtitle>
          <CardText>Some quick example text to build on the card title and make up the bulk of the card's content.</CardText>
          <Button>Button</Button>
        </CardBody>
      </Card>
    </div>
    );
  }
}


export default Icons;
